tags.onStorySubscribed:
@if (that.story !== player.getCurrentStory()) {
    return;
}

const ab1Core = getBot(byTag('ab-id', 'core'));
if (ab1Core) {
    console.log('[ab-1 bootstrap] ab-1 already detected. Skipping bootstrap.');
    return;
}
try {
    const response = await webhook({
        method: "GET",
        url: `https://auxplayer.com/webhook/ab-1/download?story=ab-1`
    });

    if (response.status !== 200) {
        console.log('[ab-1 bootstrap] Could not download installer.');
        return;
    }

    const dataOutput = response.data.data;
    for (let i = 0; i < dataOutput.length; i++) {
        const newBot = dataOutput[i];
        let b = create(newBot.tags);
        b.tags.creator = null;
    }

    console.log(`[ab-1 bootstrap] Installed ab-1 version ${response.data.version}!`);
} catch(e) {
    console.log('[ab-1 bootstrap] Could not download installer.');
    return;
}
